## [Plotly](https://plotly.com/graphing-libraries/) uses JavaScript to create interactive charts

--

### But you don't have to know JavaScript to use it! ðŸŽ‰

---

### Turn any ggplot into an interactive chart with `ggplotly()`

.leftcol[


``` r
plot &lt;- gapminder %&gt;%
  filter(year == 2007) %&gt;%
  ggplot(aes(x = gdpPercap, y = lifeExp,
             size = pop, color = continent,
             label = country)) + 
  geom_point(alpha = 0.7) +
  scale_color_brewer(palette = 'Set2') +
  scale_size_area(
    guide = FALSE, max_size = 25) +
  scale_x_log10() +
  theme_bw(base_size = 16) +
  labs(x = 'GDP per capita',
       y = 'Life expectancy',
       color = 'Continent')

plot
```

]

.rightcol[

&lt;img src="figs/gapminder-2-1.png" width="504" /&gt;

]

---

### Turn any ggplot into an interactive chart with `ggplotly()`

.leftcol[


``` r
ggplotly(plot)
```

]

.rightcol[

<iframe src="figs/gapminder.html" width="100%" height="400" scrolling="no" seamless="seamless" frameBorder="0"></iframe>

]

---

### Modify the data shown with `tooltip` argument

.leftcol[


``` r
ggplotly(
  plot,
* tooltip = c("country", "pop")
)
```

]

.rightcol[

<iframe src="figs/gapminder_tooltip.html" width="100%" height="400" scrolling="no" seamless="seamless" frameBorder="0"></iframe>

]

---

### Modify other features by piping on `plotly` [functions](https://plotly.com/r/plotly-fundamentals/)

.leftcol[


``` r
ggplotly(
  plot,
  tooltip = c("country", "pop")
) %&gt;%
* layout(legend = list(
*   orientation = "h", x = 0, y = -0.3))
```

]

.rightcol[

<iframe src="figs/gapminder_legend.html" width="100%" height="500" scrolling="no" seamless="seamless" frameBorder="0"></iframe>

]

class: center, middle

## Reference guide: https://plotly.com/ggplot2/

---

## Make interactive charts with `plot_ly()`


### (More examples here: https://plotly.com/r/)

.leftcol[


``` r
*plot_ly(
  data = gapminder %&gt;% filter(year == 2007),
  type = 'scatter',
  x = ~gdpPercap,
  y = ~lifeExp,
  size = ~pop,
  color = ~continent,
  text = ~country,
  mode = "markers",
  sizes = c(10, 1000),
  marker = list(opacity = 0.5),
  hoverinfo = "text"
  ) %&gt;%
  layout(xaxis = list(type = "log"))
```

]

.rightcol[

<iframe src="figs/gapminder_plot_ly.html" width="100%" height="400" scrolling="no" seamless="seamless" frameBorder="0"></iframe>

]

---

## Animation is relatively easy with `plot_ly()`

.leftcol[


``` r
plot_ly(
* data = gapminder,
  type = 'scatter',
  x = ~gdpPercap,
  y = ~lifeExp,
  size = ~pop,
  color = ~continent,
  text = ~country,
* frame = ~year,
  mode = "markers",
  sizes = c(10, 1000),
  marker = list(opacity = 0.5),
  hoverinfo = "text"
  ) %&gt;%
  layout(xaxis = list(type = "log"))
```

]

.rightcol[

<iframe src="figs/gapminder_plot_ly_anim.html" width="100%" height="400" scrolling="no" seamless="seamless" frameBorder="0"></iframe>

]

---

### Save as html page


``` r
htmlwidgets::saveWidget(
  ggplotly(plot),
  file = here::here('figs', 'gapminder.html')
)
```

--

### Insert using iframe


``` r
htmltools::tags$iframe(
  src         = here::here('figs', 'gapminder.html'),
  width       = "100%",
  height      = "400",
  scrolling   = "no",
  seamless    = "seamless",
  frameBorder = "0"
)
```

``` r
library(reactable)

## Add more features with `sparkline` library [(example)](https://glin.github.io/reactable/articles/examples.html#embedding-html-widgets)

.leftcol40[.code60[


``` r
library(reactable)
*library(sparkline)

gapminder_summary &lt;- gapminder %&gt;%
  group_by(country) %&gt;%
  summarise(lifeExp = list(lifeExp)) %&gt;%
  mutate(leftExpTrend = NA)

gapminder_reactable_sparkline &lt;- gapminder_summary %&gt;%
  reactable(
    searchable = TRUE,
    highlight = TRUE,
    filterable = TRUE,
    defaultPageSize = 5,
    showPageSizeOptions = TRUE,
*   columns = list(
*     lifeExp = colDef(
*       cell = function(values) {
*         sparkline(
*           values, type = "bar", chartRangeMin = 0,
*           chartRangeMax = max(gapminder$lifeExp))
*       }),
*     leftExpTrend = colDef(
*       cell = function(value, index) {
*         sparkline(gapminder_summary$lifeExp[[index]])
*       })
* ))
```

]]

<iframe src="figs/gapminder_reactable_sparkline.html" width="100%" height="500" scrolling="yes" seamless="seamless" frameBorder="0"></iframe>

## Your Turn

### `hello_shiny.app`

File -&gt; New File -&gt; Shiny Web App...

]

.rightcol60[.code50[


``` r
*library(shiny)

# Define UI for application that draws a histogram
*ui &lt;- fluidPage(

    # Application title
    titlePanel("Old Faithful Geyser Data"),

    # Sidebar with a slider input for number of bins 
    sidebarLayout(
        sidebarPanel(
            sliderInput("bins",
                        "Number of bins:",
                        min = 1,
                        max = 50,
                        value = 30)
        ),

        # Show a plot of the generated distribution
        mainPanel(
           plotOutput("distPlot")
        )
    )
)

# Define server logic required to draw a histogram
*server &lt;- function(input, output) {

    output$distPlot &lt;- renderPlot({
        # generate bins based on input$bins from ui.R
        x    &lt;- faithful[, 2]
        bins &lt;- seq(min(x), max(x), length.out = input$bins + 1)

        # draw the histogram with the specified number of bins
        hist(x, breaks = bins, col = 'darkgray', border = 'white')
    })
}

# Run the application 
*shinyApp(ui = ui, server = server)
```

]]

# **Output**: display something to the user

Output function  | Description
-----------------| ---------------
`plotOutput()`   | Display a reactive _plot_
`dataTableOutput()` | Display a `DT::datatable()`
`textOutput()`   | Display reactive _text_
`imageOutput()`  | Display an image

## Link plot to output with `output$&lt;id&gt;`

.leftcol45[

`ui`

``` r
ui &lt;- fluidPage(
  sidebarLayout(
    sidebarPanel(
      radioButtons(â€¦) 
    ), 
    mainPanel(
*     plotOutput(
*       outputId = "mpg_plot"
*     )
    )
  )
)
```

]

.rightcol55[

`server`

``` r
server &lt;- function(input, output, session) {
* output$mpg_plot &lt;- renderPlot({
    ggplot(mpg) +
      geom_point(
        aes(x = displ, y = hwy, color = class))
  })
}
```

]

---

## Link user inputs to plot with `input$&lt;id&gt;`

.leftcol[.code60[

`ui`

``` r
ui &lt;- fluidPage(
  sidebarLayout(
    sidebarPanel(
      radioButtons(
*       inputId = "xvar",
        label = "Select the x-axis variable:",
        selected = "displ",
        choices = c(
*         "Highway miles per gallon" = "hwy",
*         "City miles per gallon" = "cty",
*         "Engine displacement, in litres" = "displ")
      ),
    ), 
    mainPanel(
      plotOutput(
        outputId = "mpg_plot" 
      ) 
    )
  )
)
```

]]

.rightcol[.code60[

`server`

``` r
server &lt;- function(input, output, session) {
  output$mpg_plot &lt;- renderPlot({ 
    ggplot(mpg) +
      geom_point(
*       aes_string(
*         x = input$xvar,
          y = "hwy", 
          color = "class")) 
  })
}
```

**Note**: I switched the ggplot code from&lt;/br&gt;`aes()` to `aes_string()`

]]
